import { gql } from '@apollo/client';

export interface SearchQueryRepositoryNodeProps {
  id: string,
  name: string,
  description: string,
  url: string,
  updatedAt: Date,
  createdAt: Date,
}

export interface SearchQueryRepositoryProps {
  search?: {
    nodes?: SearchQueryRepositoryNodeProps[],
    pageInfo: {
      startCursor?: string,
    }
  }
}

export const searchQueryRepository = gql`
  query Repository($query: String!, $type: SearchType!, $after: String, $first: Int) {
    search(query: $query, type: $type, after: $after, first: $first) {
      nodes {
        ... on Repository {
          name
          description
          url
          updatedAt
          createdAt,
          id
        }
      }
    }
  }
`

export const searchQueryUser = gql`
  query Repository($query: String!, $type: SearchType!, $after: String, $first: Int) {
    search(query: $query, type: $type, after: $after, first: $first) {
      nodes {
        ... on User {
          name
          description
          url
          updatedAt
          createdAt
        }
      }
    }
  }
`
